#!/bin/bash

## THIS WILL BE CALLED BY APACHE AND WILL GENERATE DYNAMIC CONTENT 

right_arrow='data:image/gif;base64,';
left_arrow='data:image/gif;base64,';

printf "Content-type: text/html\n\n"
reload='<html><head><meta http-equiv="Refresh" content="0.1; url=http://mov.ez"/></head><body></body></html>';

if [ -z "$QUERY_STRING" ]
	then
		echo "$reload";
		exit;
fi

if ( egrep -iqe 'page=[0-9]+' <<< "$QUERY_STRING" )
	then
		page=$(sed -E 's/.*page=([0-9]+).*/\1/gi' <<< "$QUERY_STRING");
	else
		echo "$reload";
		exit;
fi

if ( egrep -iqe 'session=[A-Z0-9 _\.]{3,15}' <<< "$QUERY_STRING" )
	then
		session=$(sed -E 's/.*session=([A-Z0-9 _\.]{3,15}).*/\1/gi' <<< "$QUERY_STRING");
	else
		echo "$reload";
		exit;
fi

preamble='<!DOCTYPE html><html><head><link rel="shortcut icon" href="http://mov.ez/img/favicon.ico"><link rel="stylesheet" type="text/css" href="http://mov.ez/css/main.css"><link rel="stylesheet" type="text/css" href="http://mov.ez/css/series-specific.css"><title>mov.ez</title></head><body><div class="container"><div class="header neu-passive"><a href="http://mov.ez/"><div class="home_button neu"><img src="http://mov.ez/img/home.png"></div></a><div class="other-offerings"><div class="offerings-container"><a href="http://mov.ez/cgi-bin/moviesy_series/main_dl.sh?session='"$session"'"><div class="offering neu"><img src="http://mov.ez/img/tv-100.png"></div></a><a href="http://mov.ez/cgi-bin/moviesy_feature/main_dl.sh?page=1&session='"$session"'"><div class="offering neu"><img src="http://mov.ez/img/movies-100.png"></div></a><a href="http://mov.ez/cgi-bin/moviesy_korean/main_dl.sh?session='"$session"'"><div class="offering neu"><img src="http://mov.ez/img/korean.png"></div></a></div></div><div class="search_bar"><form action="http://mov.ez/cgi-bin/search_feature_dl.sh" method="get" enctype="application/x-www-form-urlencoded" autocomplete="off" novalidate><input class="neu" type="text" placeholder="Search" name="query'"$session"'"><img class="search_icon_style" src="http://mov.ez/img/search_icon.png"></form></div></div><div class="landing neu-passive">'
iterated="";

cd /var/www/html/movie;
# TODO 
#  instead of working only in 2020 extract all directories that contain features and iterate over those
#  asserting beforehand that the list be sorted in order of latest-ness
dirs=$(for dir in 20{99..10}; do if [ -d "$dir" ]; then cd "$dir"; ls --sort=time | egrep -v '(pages|index.html)' | sed -E "s/^/$dir\//gi"; cd ../;fi ; done)
dir_raw="$dirs";
dirs=$(head -n "$((page*52))" <<< "$dirs" | tail -n 52);

# if last page, no next button
# logic if $page*52 -ge wc -l of dirs, then we are at last page

last_page="false";
if [ "$((page*52))" -ge "$(wc -l <<< "$dir_raw")" ]
	then 
		last_page="true"; 
fi

while read dir
	do
		if [ -d "$dir" ]
			then
				iterated="$iterated"'<a href="'"http://mov.ez/cgi-bin/moviesy_feature/loader_dl.sh?$(pwd)/$dir"'&session='"$session"'"><div class="card neu-passive"><div class="card-img neu_inset"><img src="'"http://mov.ez/movie/$dir/poster.jpg"'"></div><div class="card-button neu_inset"><span>'"$(sed -E 's/.+\/([^\/]+)$/\1/gi' <<< "$dir")"'</span></div></div></a>';
		fi
done <<< "$dirs"

if [ "$page" == 1 ]
	then
		if [ "$last_page" == "true" ]
			then
				footer='</div>''<div class="navigation"><div class="nav-button neu_inset_passive"></div><div class="nav-button neu_inset"></div></div>''</div></body></html>';
			else
				footer='</div>''<div class="navigation"><div class="nav-button neu_inset"></div><div class="nav-button neu_inset"><a href="http://mov.ez/cgi-bin/moviesy_feature/main_dl.sh?page='"$((page+1))"'&session='"$session"'"><img width="100px" src="'"$right_arrow"'"></a></div></div>''</div></body></html>';
		fi
	else
		if [ "$last_page" == "true" ]
			then
				footer='</div>''<div class="navigation"><div class="nav-button neu_inset"><a href="http://mov.ez/cgi-bin/moviesy_feature/main_dl.sh?page='"$((page-1))"'&session='"$session"'"><img width="100px" src="'"$left_arrow"'"></a></div><div class="nav-button neu_inset"></div></div>''</div></body></html>';
			else
				footer='</div>''<div class="navigation"><div class="nav-button neu_inset"><a href="http://mov.ez/cgi-bin/moviesy_feature/main_dl.sh?page='"$((page+1))"'&session='"$session"'"><img width="100px" src="'"$left_arrow"'"></a></div><div class="nav-button neu_inset"><a href="http://mov.ez/cgi-bin/moviesy_feature/main.sh?page='"$((page+1))"'&session='"$session"'"><img width="100px" src="'"$right_arrow"'"></a></div></div>''</div></body></html>';
		fi
fi

page="$preamble""$iterated""$footer	";

echo "$page"